<template>
	<view id="map">
		<image 
		@click="tabAction"
		src="data:image/jpeg;base64," mode=""></image>
	</view>
</template>

<script>
	import {mapState} from "vuex";
	export default {
		onLoad(){
			this.getLocate();
		},
		computed:{
			...mapState({locate: state => state.location})
		},
		methods:{
			tabAction(){
				this.getLocate();
			},
			getLocate(){
				uni.showLoading({
					mask:true,
					title:"..."
				});
				uni.getLocation({
					type: 'wgs84',
					success:({longitude,latitude})=>{
						uni.openLocation({
							latitude: this.locate.latitude||latitude,
							longitude: this.locate.longitude||longitude,
							success: function () {
								uni.hideLoading();
							},
							fail:function(err){
								console.log(err);
							}
						});
						uni.chooseLocation({
						    success: function (res) {
								uni.openLocation({
									latitude: res.latitude,
									longitude: res.longitude,
									success: function () {
										console.log('' + res.name);
										console.log('' + res.address);
										uni.hideLoading();
									}
								});
						    }
						})
					},
				});
			}
		}
	}
</script>

<style lang="scss">
#map{
	height: 600px;
	image{
		width: 100%;
		height:100%;
	}
}
</style>
